// src/components/Dashboard.jsx
import React, { useState } from 'react';
import { User, Phone, Mail, Search, Plus, Edit2, Trash2, Users, BookOpen, Settings, LogOut } from 'lucide-react';
import ContactForm from './ContactForm';
import CategoryForm from './CategoryForm';

const Dashboard = ({ currentUser, onLogout }) => {
  // ... (initial state setup unchanged)

  const styles = {
    dashboard: {
      display: 'flex',
      minHeight: '100vh',
      background: '#e3f2fd', // light blue background
      color: '#2c3e50',
    },
    sidebar: {
      width: '260px',
      backgroundColor: '#ffffff',
      borderRight: '1px solid #cfd8dc',
      padding: '2rem 1rem',
    },
    sidebarTitle: {
      fontSize: '1.75rem',
      fontWeight: 'bold',
      marginBottom: '2rem',
      color: '#1976d2',
      textAlign: 'center',
    },
    navItem: {
      display: 'flex',
      alignItems: 'center',
      padding: '0.75rem 1rem',
      margin: '0.5rem 0',
      borderRadius: '8px',
      cursor: 'pointer',
      transition: 'background 0.2s',
      color: '#455a64',
    },
    navItemActive: {
      backgroundColor: '#bbdefb',
      color: '#0d47a1',
    },
    navIcon: { marginRight: '0.75rem' },
    mainContent: { flex: 1, padding: '2rem' },
    header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '2rem' },
    headerTitle: { fontSize: '2rem', fontWeight: '600', color: '#0d47a1' },
    userInfo: { display: 'flex', alignItems: 'center', gap: '1rem' },
    avatar: {
      width: '44px',
      height: '44px',
      borderRadius: '50%',
      backgroundColor: '#42a5f5',
      overflow: 'hidden',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      fontSize: '1.1rem',
      color: 'white',
    },
    controls: { display: 'flex', gap: '1rem', marginBottom: '1.5rem', flexWrap: 'wrap' },
    searchBox: { flex: 1, minWidth: '200px', position: 'relative' },
    searchInput: {
      width: '100%',
      padding: '0.75rem 1rem 0.75rem 3rem',
      border: '2px solid #90caf9',
      borderRadius: '25px',
      backgroundColor: 'white',
    },
    searchIcon: { position: 'absolute', left: '1rem', top: '50%', transform: 'translateY(-50%)', color: '#90a4ae' },
    select: {
      padding: '0.75rem 1rem',
      border: '2px solid #90caf9',
      borderRadius: '8px',
      backgroundColor: 'white',
    },
    addButton: {
      display: 'flex',
      alignItems: 'center',
      gap: '0.5rem',
      padding: '0.75rem 1.5rem',
      backgroundColor: '#42a5f5',
      color: 'white',
      border: 'none',
      borderRadius: '8px',
      cursor: 'pointer',
      fontSize: '1rem',
      boxShadow: '0 4px 15px rgba(66,165,245,0.3)',
    },
    contactGrid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fill, minmax(280px, 1fr))',
      gap: '1.5rem',
    },
    contactCard: {
      backgroundColor: 'white',
      borderRadius: '12px',
      padding: '1.25rem',
      boxShadow: '0 6px 18px rgba(0,0,0,0.06)',
      transition: 'transform 0.2s, box-shadow 0.2s',
    },
    contactHeader: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '0.75rem' },
    contactName: { fontSize: '1.25rem', fontWeight: '600', color: '#0d47a1' },
    contactCategory: {
      fontSize: '0.8rem',
      color: '#1976d2',
      backgroundColor: '#bbdefb',
      padding: '0.25rem 0.75rem',
      borderRadius: '16px',
    },
    contactInfo: { display: 'flex', alignItems: 'center', gap: '0.5rem', marginBottom: '0.5rem', color: '#455a64' },
    contactActions: { display: 'flex', gap: '0.5rem', marginTop: '0.75rem' },
    actionButton: {
      padding: '0.5rem',
      border: 'none',
      borderRadius: '6px',
      cursor: 'pointer',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
    },
    editButton: { backgroundColor: '#ffb300', color: 'white' },
    deleteButton: { backgroundColor: '#ef5350', color: 'white' },
    emptyState: { textAlign: 'center', color: '#78909c', fontSize: '1.2rem', padding: '2rem' },
  };

  // ... (functions unchanged)

  return (
    <div style={styles.dashboard}>
      <aside style={styles.sidebar}>
        <h2 style={styles.sidebarTitle}>Contact Book</h2>
        <nav>
          {sidebarItems.map(item => {
            const Icon = item.icon;
            const isActive = activeTab === item.id;
            return (
              <div
                key={item.id}
                style={{ ...styles.navItem, ...(isActive ? styles.navItemActive : {}) }}
                onClick={() => setActiveTab(item.id)}
              >
                <Icon size={20} style={styles.navIcon} />
                {item.label}
              </div>
            );
          })}
          <div style={{ ...styles.navItem, marginTop: '2rem' }} onClick={onLogout}>
            <LogOut size={20} style={styles.navIcon} />
            Logout
          </div>
        </nav>
      </aside>

      <main style={styles.mainContent}>
        <header style={styles.header}>
          <h1 style={styles.headerTitle}>
            {activeTab === 'contacts' ? 'My Contacts'
              : activeTab === 'categories' ? 'Categories'
              : 'Settings'}
          </h1>
          <div style={styles.userInfo}>
            <div style={styles.avatar}>
              {currentUser.photo ? (
                <img src={currentUser.photo} alt="avatar" style={{ width: '100%', height: '100%' }} />
              ) : currentUser.name.charAt(0).toUpperCase()}
            </div>
            <span>{currentUser.name}</span>
          </div>
        </header>

        {/* Rest unchanged for contacts/categories/settings */}

      </main>

      {/* Add / Edit modals */}
      { showAddContact && (
        <ContactForm
          categories={categories}
          onSave={addContact}
          onCancel={() => setShowAddContact(false)}
        />
      )}
      {/* editing */}
      { editingContact && (
        <ContactForm
          contact={editingContact}
          categories={categories}
          onSave={updateContact}
          onCancel={() => setEditingContact(null)}
        />
      )}
      { showAddCategory && (
        <CategoryForm
          onSave={addCategory}
          onCancel={() => setShowAddCategory(false)}
        />
      )}
    </div>
  );
};

export default Dashboard;
